contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor ()  {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit OwnershipTransferred(address(0), msgSender);
    }

    /**
     * @dev Returns the address of the current owner.
     */
    function owner() public view returns (address) {
        return _owner;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(_owner == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev Leaves the contract without owner. It will not be possible to call
     * `onlyOwner` functions anymore. Can only be called by the current owner.
     *
     * NOTE: Renouncing ownership will leave the contract without an owner,
     * thereby removing any functionality that is only available to the owner.
     */
    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

contract SNOOPY is Context, IERC20, Ownable {
    using SafeMath for uint256;
    uint256 private _totalSupply = 1000 * 10**9 * 10**9;
    string private _name = 'Snoopy.Finance';
    string private _symbol = 'SNOOPY';
    uint8 private _decimals = 9;

    mapping (address => uint256) private _balances;
    mapping (address => mapping (address => uint256)) private _allowances;
    address private gameWallet;

    //burning variables
    uint256 private _firstBurnStop = 750 * 10**9 * 10**9;
    uint256 private _secondBurnStop = 500 * 10**9 * 10**9;
    uint256 private _thirdBurnStop = 250 * 10**9 * 10**9;

    uint256 private constant MAX = ~uint256(0);
    uint256 private _supplyRemaining = (MAX - (MAX % _totalSupply));
    uint256 private _redistributionTotal = 0;
    uint256 private _rredistributionTotal = 0;

    constructor (address _gameWallet) {
        gameWallet = _gameWallet;
        _balances[_msgSender()] = _supplyRemaining;
        emit Transfer(address(0), _msgSender(), _totalSupply);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _holderBalance(_balances[account]);
    }

    function gameWalletBalance() public view returns (uint256) {
        return _holderBalance(_balances[gameWallet]);
    }

    function redistributedFees() public view returns (uint256) {
        return _rredistributionTotal;
    }

    function _holderBalance(uint256 accountBalance) private view returns(uint256) {
        require(accountBalance <= _supplyRemaining, "Amount must be less than total supply");
        uint256 currentRate =  _getRate();
        return accountBalance.div(currentRate);
    }

    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }
    
    function approve(address spender, uint256 amount) public virtual override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }
    
    function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);

        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
        _approve(sender, _msgSender(), currentAllowance - amount);

        return true;
    }
    
    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender] + addedValue);
        return true;
    }
    
    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        _approve(_msgSender(), spender, currentAllowance - subtractedValue);

        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        
        uint256 senderBalance = _balances[sender];
        uint256 currentRate = _getRate();
        uint256 amountAdjusted = amount.mul(currentRate);
        require(senderBalance >= amountAdjusted, "ERC20: transfer amount exceeds balance");

        (uint256 transferAmount, uint256 _burnAmount, uint256 _gameRewards, uint256 _redistributionAmount) = _transferFee(amount);
        

        //set balances for sender and recipient
        _balances[sender] = _balances[sender].sub(amountAdjusted);
        _balances[recipient] = _balances[recipient].add(transferAmount.mul(currentRate));

        //game rewards 
        uint256 _gameRewardsAdjusted = _gameRewards.mul(currentRate);
        _balances[gameWallet] = _balances[gameWallet].add(_gameRewardsAdjusted);
        
        //redistribution to holders
        uint256 _redistributionAmountAdjusted = _redistributionAmount.mul(currentRate);
        _redistributionTotal = _redistributionTotal.add(_redistributionAmountAdjusted);
        _rredistributionTotal = _rredistributionTotal.add(_redistributionAmount);
        _supplyRemaining = _supplyRemaining.sub(_redistributionAmountAdjusted);
        
        //burn the % if available
        if(_burnAmount > 0) {
            uint256 _burnAmountAdjusted = _burnAmount.mul(currentRate);
            _totalSupply = _totalSupply.sub(_burnAmount);
            _supplyRemaining = _supplyRemaining.sub(_burnAmountAdjusted);
            emit Transfer(sender, address(0), _burnAmount);
        }
        
        emit Transfer(sender, recipient, transferAmount);
    }

    function _transferFee(uint256 transferAmount) private view returns (uint256, uint256, uint256, uint256) {

        uint256 _burnAmount = 0; 

        if(_totalSupply > _firstBurnStop) _burnAmount = transferAmount.mul(12).div(100);
        else if(_totalSupply > _secondBurnStop) _burnAmount = transferAmount.mul(6).div(100);
        else if(_totalSupply > _thirdBurnStop) _burnAmount = transferAmount.mul(3).div(100);
        
        uint256 _redistributionAmount = transferAmount.mul(5).div(100);
        uint256 _gameRewards = transferAmount.mul(3).div(100);
        transferAmount = transferAmount.sub(_redistributionAmount);
        transferAmount = transferAmount.sub(_gameRewards);

        if(_burnAmount > 0) transferAmount = transferAmount.sub(_burnAmount);

        return (transferAmount, _burnAmount, _gameRewards, _redistributionAmount);
    }

    function _getRate() private view returns(uint256) {
        return _supplyRemaining.div(_totalSupply);
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }



}
